import React from 'react';
import ReactDom from 'react-dom';

const App = () => {
  return (
    <React.Fragment>
      <h1>Hello World</h1>
      <p>Fucking World</p>
    </React.Fragment>
  );
};

ReactDom.render(<App />, document.getElementById("root"));
